                    if(e == ModalExitOptions.ACCEPT){
                        DrugsSrv.getInstance().remove(this.context.getStt().item.id!);
                        toast("Medicamento eliminado con exito");
                        newState = {
                            item: {},
                            selectedItem: "-1",
                            fStt: new WaitingState(this.context)
                        };
